export default {
  name: 'GroupList',
  props: {
    values: {
      type: Array,
      default: function() {
        return []
      }
    },
    loading: {
      type: Boolean,
      default: false
    }
  },
  methods: {
    groupEdit(group) {
      this.$emit('edit', group)
    },
    permEdit(group) {
      this.$emit('editPerm', group)
    },
    groupDelete(group) {
      this.$confirm(`此操作将删除该${group.name}用户记录, 是否继续?`, '删除机房', {
        confirmButtonText: '确定',
        cancelButtonText: '取消',
        type: 'warning'
      }).then(() => {
        this.$emit('delete', group.id)
      }).catch(() => {
        this.$message({
          type: 'info',
          message: '已取消删除'
        })
      })
    },
    groupMember(group) {
      this.$emit('list', group)
    }

  }
}
